function Register() {
  return (
    <div className="entrance-page">
      <p className="entrance-page__title">Регистрация</p>
      <form
        className="entrance-page__form"
        name="register"
      >
        <input className="entrance-page__change-line" type="email" name="email" placeholder="Email"></input>
        <input className="entrance-page__change-line" type="password" name="password" placeholder="Пароль"></input>
        <button className="entrance__button">Зарегистрироваться</button>
      </form>
      <p className="entrance-page__text">Уже зарегистрированы? Войти</p>
    </div>
  );
}

export default Register;
